import React from 'react'
import { withStyles, makeStyles,CssBaseline , ThemeProvider, createMuiTheme} from '@material-ui/core'
import AddIcon from '@material-ui/icons/Add';
import PageHeader from './PageHeader';

const style = {
    sideMenu: {
        display: 'flex',
        flexDirection: 'column',
        position: 'absolute',
        left: '0px',
        width: '320px',
        height: '100%',
        backgroundColor: '#253053'
    }
}

const SideMenu = (props) => {

    const { classes } = props
    return (
        <ThemeProvider theme={classes.sideMenu}>
        <SideMenu />
         <div className={classes.appMain}>
         <PageHeader
            title="User"
            icon={<AddIcon/>}
            />
        <PageHeader
            title="Team"
            icon={<AddIcon fontSize="large"/>}
            />
        </div>
    </ThemeProvider>

    )
}
export default withStyles(style)(SideMenu)
